    // ... ->> (Mostly) Compile-time indexing for byte sizes
    constexpr unsigned char byteat(bool           const source[], std::size_t const index) noexcept { return (source[index / sizeof(bool)]           >> (CHAR_BIT * (index % sizeof(bool))))           & UCHAR_MAX; }
